import { useEffect } from "react";
import AppRouter from "./AppRouter";

function AppHeader(){
    return(
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-primary">
            {/* Container wrapper */}
            <div className="container-fluid">
                {/* Toggle button */}
                <button className="navbar-toggler" type="button" data-mdb-toggle="collapse" data-mdb-target="#navbarLeftAlignExample" aria-controls="navbarLeftAlignExample" aria-expanded="false" aria-label="Toggle navigation">
                <i className="fas fa-bars" />
                </button>
                {/* Collapsible wrapper */}
                <div className="collapse navbar-collapse" id="navbarLeftAlignExample">
                {/* Left links */}
                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                    <li className="nav-item">
                    <a className="nav-link active" aria-current="page" href="/nodebt">รายงานผู้ใช้น้ำที่ยังไม่ได้ตั้งหนี้</a>
                    </li>
                    <li className="nav-item">
                    <a className="nav-link" href="#">Link</a>
                    </li>
                    {/* Navbar dropdown */}
                    <li className="nav-item dropdown">
                    <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-mdb-toggle="dropdown" aria-expanded="false">
                        เลือกรายงาย
                    </a>
                    {/* Dropdown menu */}
                    <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                        <li>
                            <a className="dropdown-item" href="#">รายละเอียด ผชน. ที่ยังไม่ได้ตั้งหนี้</a>
                        </li>
                        <li>
                            <a className="dropdown-item" href="#">สรุปรายสาขา</a>
                        </li>
                        <li><hr className="dropdown-divider" /></li>
                        <li>
                            <a className="dropdown-item" href="#">TBA</a>
                        </li>
                    </ul>
                    </li>
                </ul>
                {/* Left links */}
                </div>
                {/* Collapsible wrapper */}
            </div>
            {/* Container wrapper */}
            </nav>


        </div>
    );
}

export default AppHeader;
